import React from 'react'

const SideBar = ({preFillDates}) => {
  return (
    <div className='container'>
      <div className="row">
        <div clclassName="col">
          <input type="text" className="form-control" placeholder="Time In" />
        </div>
        <div className="col">
          <input type="text" className="form-control" placeholder="Time Out" />
        </div>
        <div className="col">
          <button onClick={preFillDates} type="button" className="btn btn-success">Prefill</button>
        </div>

      </div>
    </div>
  );
};
export default SideBar;
